    expected_e_sm_commitment: pub Field,
    ct0: pub [Polynomial<N>; L],
    ct1: pub [Polynomial<N>; L],
    sk: [Polynomial<N>; L],
    e_sm: [Polynomial<N>; L],
    r1: [Polynomial<(2 * N) - 1>; L],
    r2: [Polynomial<N - 1>; L],
    d: [Polynomial<N>; L],
) {
